import React from 'react';
import './Profile.css'; // Make sure to create and import a CSS file for styling

const Profile = () => {
  const user = {
    name: 'John Doe',  // Sample user name
    email: 'john.doe@example.com',  // Sample email
    avatar: 'https://via.placeholder.com/100', // Placeholder user avatar URL
  };

  return (
    <div className="profile-container">
      <img src={user.avatar} alt="User Avatar" className="user-icon" />
      <h2 className="user-name">{user.name}</h2>
      <p className="user-email">{user.email}</p>
      <button className="logout-button">Log Out</button>
    </div>
  );
};

export default Profile;
